<p>-----API.JS-----</p>

<pre><code>router.get('/external_sources_details_filtered',(req,res) =&gt;{
   connection((db) =&gt; {
   let parameterValue = String( 'frequency.'+ req.query.frequency);
        console.log(parameterValue);
        var query1 = {parameterValue :{$exists:true}};
        var query2 ={'frequency.Monthly':{$exists:true}};
        console.log(query1);
        console.log(query2);
        var projection = {_id:0,sourceID:1,SourceName:1, Outstanding:1};
         db.collection('external_sources').find(query2)
         .project(projection).toArray()
         .then((external_sources_details_filtered) =&gt; {
          response.data = external_sources_details_filtered;
         res.json(response);
    })
  })      
 }) 
</code></pre>

<p>Output of console.log(<strong>query1</strong>) = { parameterValue: { '$exists': true } }</p>

<p>Output of console.log(<strong>query2</strong>) = { 'frequency.Monthly': { '$exists': true } }</p>

<p>Why does parameterValue is not being fetched while passing it in query1 even after casting  parameterValue to string?</p>

