How to create common entities for RDBMS and MongoDB?<p>I have a Spring Boot RESTful service that interacts with H2 RDBMS. 
I've decided to extend it by adding MongoDB support and to create two profiles, each for each data source.</p>

<p>My intention is to use common entities so I've started with changing <code>id</code> fields from <code>Long</code> to <code>BigInteger</code> because if I use <code>String</code> as <code>id</code> it will cause performance troubles with SQL insertions.</p>

<pre><code>@Document
@Entity
@NoArgsConstructor
@AllArgsConstructor
@Builder
@Getter
@EqualsAndHashCode
@ToString
public final class Book {

    @org.springframework.data.annotation.Id
    @Id
    @GeneratedValue(strategy = GenerationType.IDENTITY)
    private BigInteger id;

    private String title;

    @ManyToOne(optional = false)
    private Author author;

}
</code></pre>

<p>And, of course, corresponding repositories too.</p>

<pre><code>public interface BookRepository extends CrudRepository&lt;Book, BigInteger&gt; {}
</code></pre>

<p>I also modified the H2 tables by substituting BIGINT type by BIGDECIMAL and refilled my tables. I have <code>spring.jpa.hibernate.ddl-aeuto=validate</code> in my properties and Hibernate validation complained to match <code>java.math.BigInteger</code> with <code>BIGINT</code> from db.</p>

<p>After all, I debugged my app but all the methods belonged to repository return empty results even <code>findAll()</code>, but I see that records are presented in tables and <code>"SELECT * from 'table'(e.g. BOOK)"</code> returns all records.</p>

<p>Could you clarify me some questions?</p>

<p>Is it a good way to combine JPA's and MongoDB's entity in one class? Does Spring Data work fine with BigInteger? Any hints?</p>

<p>UPDATE:
I've tried to start from the scratch and I found that after annotating entities with @Document annotation CRUD repository starts to misbehave and fails with org.springframework.data.mapping.PropertyReferenceException on methods annotated @Query(native=true)</p>

