</code></pre>

<p>I am well aware that the error happens in runtime and that the possible cause is my classpath.</p>

<p>Currently I copied all of my code from one project to another, added Maven dependencies and the following happens:</p>

<ul>
<li><p>if I create a separate .java file for my MongoDB and run it in the same folder that the Glassfish server is, it works perfectly fine.</p></li>
<li><p>if I run the server and try to call methods from the other class (a little bit modified) the upper error appears</p></li>
</ul>

<p>Simplified code example withouth error:</p>

<pre><code>import org.bson.Document;
import org.bson.conversions.Bson;
import com.mongodb.BasicDBObject;
import com.mongodb.MongoClient;
