Error Handling: E11000 duplicate key error collection<p>I am having a problem with the user model that I'm using with Mongoose and MongoDB to create each profile in my database. It works fine to post one user, but throws the following error if I logout and try again:</p>

<pre><code>{
    "name": "MongoError",
    "message": "E11000 duplicate key error collection: CourtAPIDev.users index: trackers.case_id_1 dup key: { : null }",
    "driver": true,
    "index": 0,
    "code": 11000,
    "errmsg": "E11000 duplicate key error collection: CourtAPIDev.users index: trackers.case_id_1 dup key: { : null }"
}
</code></pre>

<p>According to mongoose documentation: <strong>If there is more than one document (a second user) without a value for the indexed field or is missing the indexed field, the index build will fail with a duplicate key error.</strong> I don't know how to set this _id property for the trackers property  I thought it generated automatically!</p>

<p>Here's the trackers part of my Schema. And the relevant case_id property, which seems to be throwing the "null" error.</p>

<p><a href="https://i.stack.imgur.com/xbksn.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/xbksn.png" alt="enter image description here"></a>
<a href="https://i.stack.imgur.com/AZyjA.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/AZyjA.png" alt="enter image description here"></a></p>

<p>The whole repository can be found on my Github here, but the likely problem spots are the ones I highlighted, I think. Here's the github link: <a href="https://github.com/KingOfCramers/node_login_with_trackers" rel="nofollow noreferrer">https://github.com/KingOfCramers/node_login_with_trackers</a></p>

<p>user model:</p>

<pre><code>const UserSchema = new mongoose.Schema({
    email: {
        type: String,
        required: true,
        trim: true,
        minLength: 1,
        unique: true,
        validate: {
            validator: (value) =&gt; {
                return validator.isEmail(value);
            },
            message: '{VALUE} is not a valid email'
        }
    },
    password: {
        type: String,
        required: true,
        minlength: 6
    },
    tokens: [{
        access: {
            type: String,
            required: true
        },
        token: {
            type: String,
            required: true
        }
    }],
    trackers: {
        tweets: [TwitterSchema],
        legislation: [LegislationSchema],
        court_cases: [CourtCaseSchema]
    },
    frequency: [EmailSchema]
});
</code></pre>

<p>Express route:</p>

<pre><code>app.post("/users", (req,res) =&gt; {
    var body = _.pick(req.body, ['email', 'password']);
    body.frequency = {
        alert_time: new Date(),
        email: req.body.email
    }
    var user = new User(body);

    user.save().then(() =&gt; {
        return user.generateAuthToken();
    }).then((token) =&gt; {
        res.header("x-auth", token);
        res.send(user);
    }).catch((e) =&gt; {
        res.status(400).send(e);
    });
});
</code></pre>

<p>Test (mocha):</p>

<pre><code> it("Should post a new user", (done) =&gt; {
        var email = "uniqueemail@example.com"
        var password = "9webipasd"
        supertest(app)
            .post("/users") // Post request to the /todos URL
            .send({
                email,
                password
            })
            .expect(200)
            .expect((res) =&gt; {
                expect(res.headers).toIncludeKey('x-auth')
                expect(res.body._id).toExist();
                expect(res.body.email).toBe(email);
            })
            .end((err) =&gt; {
                if(err){
                    return done(err);
                }
                User.findOne({email}).then((user) =&gt; {
                    expect(user).toExist();
                    expect(user.password).toNotBe(password);
                    done();
                }).catch((e) =&gt; done(e));
            });
    });
</code></pre>

