<li>users </li>
<li>transactions</li>
</ol>

<p>Here i have to update wallet of thousands of users with some amount and if successful create a new document with related info for each transaction, This is My code :</p>

<pre><code> userModel.update({_id : ObjectId(userId)}, {$inc : {wallet : 500}}, function (err, creditInfo) {
    if(err){
        console.log(err);                            
    }
    if(creditInfo.nModified &gt; 0) {
        newTransModel = new transModel({
            usersId: ObjectId(userId),            
            amount: winAmt,         
            type: 'credit',           
        }); 
