EclipseLink: Inheritance with mongoDB as persistence layer<p>I'm trying to setup a webapp with Jersey using a MongoDB as persistence layer. My JPA framework is EclipseLink.</p>

<p>I've run into a problem with persisting objects which classes are extending other (abstract) classes.</p>

<p>For example given the following abstract class:</p>

<pre><code>@Entity
@NoSql(dataFormat=DataFormatType.MAPPED)
public abstract class AbstractClass {

    @Id
    @Field(name="_id")
    protected String id;

    public String getId() {

        return this.id;
    }
}
</code></pre>

<p>And this extending class:</p>

<pre><code>@Entity
@NoSql(dataFormat=DataFormatType.MAPPED)
@XmlRootElement
@XmlAccessorType(XmlAccessType.FIELD)
public class ExtendedClass extends AbstractClass {

    @Basic
    private String name;

    public ExtendedClass() {

    }

    public ExtendedClass(String id, String name) {

        this.id = id;
        this.name = name;
    }

    public String getName() {

        return this.name;
    }
}
</code></pre>

<p>Here is the <code>persistence.xml</code>file I'm using:</p>

<pre><code>&lt;?xml version="1.0" encoding="UTF-8"?&gt;
&lt;persistence version="2.1" xmlns="http://xmlns.jcp.org/xml/ns/persistence" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance" xsi:schemaLocation="http://xmlns.jcp.org/xml/ns/persistence http://xmlns.jcp.org/xml/ns/persistence/persistence_2_1.xsd"&gt;
    &lt;persistence-unit name="persistence-unit" transaction-type="RESOURCE_LOCAL"&gt;
        &lt;class&gt;org.example.webapp.resources.test.AbstractClass&lt;/class&gt;
        &lt;class&gt;org.example.webapp.resources.test.ExtendedClass&lt;/class&gt;
        &lt;properties&gt;
            &lt;property name="eclipselink.target-database" value="org.eclipse.persistence.nosql.adapters.mongo.MongoPlatform"/&gt;                         
            &lt;property name="eclipselink.nosql.connection-spec" value="org.eclipse.persistence.nosql.adapters.mongo.MongoConnectionSpec"/&gt;
            &lt;property name="eclipselink.nosql.property.mongo.port" value="27017"/&gt;
            &lt;property name="eclipselink.nosql.property.mongo.host" value="ip-address"/&gt;
            &lt;property name="eclipselink.nosql.property.mongo.db" value="database-name"/&gt;
            &lt;property name="eclipselink.logging.level" value="FINEST"/&gt;
        &lt;/properties&gt;
    &lt;/persistence-unit&gt;
&lt;/persistence&gt;
</code></pre>

<p>And a webservice that creates and persists an instance of the <code>ExtendedClass</code>:</p>

<pre><code>@PUT
@Path("persist/extended-object")
@Consumes(MediaType.APPLICATION_JSON)
public String addObject(@QueryParam("name") final String name) {

    final String id = UUID.randomUUID().toString();

    ExtendedClass theObject = new ExtendedClass(id, name);

    EntityManagerFactory emf = Persistence.createEntityManagerFactory("persistence-unit");

    EntityManager em = emf.createEntityManager();

    em.getTransaction().begin();

    em.persist(theObject);

    em.getTransaction().commit();
    em.close();

    return "Persisted object with name: " + name;
}
</code></pre>

<p>When calling the webservice with: </p>

<p><code>http://localhost:8080/webapp/webapi/test/persist/extended-object?name=test-abstraction</code> </p>

<p>I can create a new entry in the mongoDb database that  looks like this:
<a href="https://i.stack.imgur.com/KMlKj.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/KMlKj.png" alt="persisted object"></a></p>

<p>So far so good. However if I try to get a list with all the persisted objects I run into a problem. Here is the example webservice:</p>

<pre><code>@GET
@Path("get/all")
@Produces(MediaType.APPLICATION_JSON)
public List&lt;ExtendedClass&gt; getAllExtendedClasses() {

    EntityManagerFactory emf = Persistence.createEntityManagerFactory("persistence-unit");

    EntityManager em = emf.createEntityManager();

    em.getTransaction().begin();

    List&lt;ExtendedClass&gt; extendedClassList = em.createQuery("SELECT a FROM ExtendedClass a", ExtendedClass.class).getResultList();

    em.getTransaction().commit();
    em.close();

    return extendedClassList;
}   
</code></pre>

