Selecting on document "outside" of join while filtering on documents "within" join?<p>I have two <code>IMongoCollection</code>s holding documents of type <code>Person</code> and <code>Animal</code> respectively. </p>

<pre><code>public class Person
{
    public Guid PersonId { get; set; } = Guid.NewGuid();
    public Guid PetId { get; set; }
}

public class Animal
{
    public Guid AnimalId { get; set; } = Guid.NewGuid();
    public bool IsMammal { get; set; } 
}
...
Animal bootsTheMonkey = new Animal() { IsMammal = true };
Person doraTheExplorer = new Person() { PetId = bootsTheMonkey.AnimalId };
</code></pre>

<p>I am trying to write a query which finds "all persons whose pets are mammals".</p>

<pre><code>var query =
    from pDoc in PersonDocumentCollection.AsQueryable()
    where !pDoc.PetId.Equals(Guid.Empty)
    join aDoc in AnimalDocumentCollection.AsQueryable() on pDoc.PetId equals aDoc.AnimalId
        where aDoc.IsMammal
    select pDoc;
</code></pre>

<p>Though this query is incorrect evidenced by the error message</p>

<blockquote>
  <p>$project or $group does not support {document}.</p>
</blockquote>

<p>From searching it looks like this error comes about from the use of <code>where aDoc.IsMammal</code>, more specifically the use of the <code>aDoc</code> within/after the <code>join</code> (Based on this <a href="https://stackoverflow.com/questions/47383632/project-or-group-does-not-support-document">SO question</a>). Though I am not entirely sure if that is the issue.</p>

<hr>

<p>Overall I am trying to <code>join</code> two <code>IMongoCollection</code>s where the first's documents have a field whose value is the <code>BsonId</code> of a document from another collection. Then once joined I would like to first the documents from the first collection on the values of fields in the second.</p>

