embedfield:
$lookup with case sensitive fields<p>I know how to do the case insensitive search.</p>

<p>example :</p>

<ul>
<li>members.email: <code>aaa@aaa.com</code> BUT :</li>
<li><p>users.email: <code>AAA@aaa.com</code></p>

<pre><code>db.getCollection('members').aggregate([
{$lookup: {'from': 'users', 'localField': 'members.email', 'foreignField': 'email', 'as': 'users'}},
{$unwind: {path: '$users', preserveNullAndEmptyArrays: true}},
{$match : { users: { $exists: false } }},
]);
</code></pre></li>
</ul>

<p>collection member looks like:</p>

<pre><code>{
"_id" : ObjectId("5b439c02a5439e00568291fe"),
"members" : [ 
    {
        "email" : "aaa@gmail.com"
    }, 
    {
        "email" : "bbb@gmail.com"
    }, 
    {
        "email" : "ccc@gmail.com"
    }
],
"groupname" : "abuse",
"active" : true,
"createdAt" : ISODate("2018-07-09T17:31:46.098Z"),
"updatedAt" : ISODate("2018-07-09T17:31:46.098Z"),
"__v" : 0
}
</code></pre>

<p>collection member_user looks like:</p>

<pre><code>{
"_id" : ObjectId("5a7dfce545e13f0233b2e451"),
"email" : "AAA@gmail.com",
"__v" : 0
}

{
"_id" : ObjectId("5b43ac89bfd90aa9cc4a68c2"),
"email" : "bbb@gmail.com",
"__v" : 0
}
</code></pre>

<p>This is code I use:</p>

<pre><code>    db.getCollection('member').aggregate([
    {$unwind: "$members"},
    {$lookup: {'from': 'member_user', 'localField': 'members.email', 'foreignField': 'email', 'as': 'users'}},
    {$unwind: {path: '$users', preserveNullAndEmptyArrays: true}},
    {$match : { users: { $exists: false } }},
], 
{
    collation: {
        locale: 'en_US',
        strength: 1
    }
}
    );
</code></pre>

<p>when the dataset is small, the speed always very fast.  BUT I have 24K members and 7K users.  As I said, when {$match : { users: { $exists: true } }}, speed is OK, but when {$match : { users: { $exists: false } }}, speed almost 60 times.  (1 sec vs 1 min)</p>

<p>Without collation, the speed is always fast</p>

